// import './App.css';
import { useEffect, useState } from 'react';
import Movie from './Movie'

function Home() {

  const [popular, setPopular] = useState([]);
    // {console.warn(popular)}

  useEffect(() => {
    fetchPopular();
  }, []);


  const fetchPopular = async () => {
    const data = await fetch("https://api.themoviedb.org/3/movie/550?api_key=a7aec237121ee4a63d0b26fa48a23c36");
    const movies = await data.json();
    setPopular(movies);

    console.log(movies);

  };
  // console.log(popular)



  return (
    <div className="App">
      <div className="popular-movies">
        {popular.map((movies) => { return  <Movie key={movies.id} /> })}
      </div>
    </div>
  );
}

export default Home;
